INSERT INTO system_plugin_history VALUES ('3', 'RainLab.Builder', 'comment', '1.0.1', 'Initialize plugin.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('4', 'RainLab.Builder', 'comment', '1.0.2', 'Fixes the problem with selecting a plugin. Minor localization corrections. Configuration files in the list and form behaviors are now autocomplete.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('5', 'RainLab.Builder', 'comment', '1.0.3', 'Improved handling of the enum data type.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('6', 'RainLab.Builder', 'comment', '1.0.4', 'Added user permissions to work with the Builder.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('7', 'RainLab.Builder', 'comment', '1.0.5', 'Fixed permissions registration.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('8', 'RainLab.Builder', 'comment', '1.0.6', 'Fixed front-end record ordering in the Record List component.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('9', 'RainLab.Builder', 'comment', '1.0.7', 'Builder settings are now protected with user permissions. The database table column list is scrollable now. Minor code cleanup.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('10', 'RainLab.Builder', 'comment', '1.0.8', 'Added the Reorder Controller behavior.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('11', 'RainLab.Builder', 'comment', '1.0.9', 'Minor API and UI updates.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('12', 'RainLab.Builder', 'comment', '1.0.10', 'Minor styling update.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('13', 'RainLab.Builder', 'comment', '1.0.11', 'Fixed a bug where clicking placeholder in a repeater would open Inspector. Fixed a problem with saving forms with repeaters in tabs. Minor style fix.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('14', 'RainLab.Builder', 'comment', '1.0.12', 'Added support for the Trigger property to the Media Finder widget configuration. Names of form fields and list columns definition files can now contain underscores.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('15', 'RainLab.Builder', 'comment', '1.0.13', 'Minor styling fix on the database editor.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('16', 'RainLab.Builder', 'comment', '1.0.14', 'Added support for published_at timestamp field', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('17', 'RainLab.Builder', 'comment', '1.0.15', 'Fixed a bug where saving a localization string in Inspector could cause a JavaScript error. Added support for Timestamps and Soft Deleting for new models.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('18', 'RainLab.Builder', 'comment', '1.0.16', 'Fixed a bug when saving a form with the Repeater widget in a tab could create invalid fields in the form\'s outside area. Added a check that prevents creating localization strings inside other existing strings.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('19', 'RainLab.Builder', 'comment', '1.0.17', 'Added support Trigger attribute support for RecordFinder and Repeater form widgets.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('20', 'RainLab.Builder', 'comment', '1.0.18', 'Fixes a bug where \'::class\' notations in a model class definition could prevent the model from appearing in the Builder model list. Added emptyOption property support to the dropdown form control.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('21', 'RainLab.Builder', 'comment', '1.0.19', 'Added a feature allowing to add all database columns to a list definition. Added max length validation for database table and column names.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('22', 'RainLab.Builder', 'comment', '1.0.20', 'Fixes a bug where form the builder could trigger the \"current.hasAttribute is not a function\" error.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('23', 'RainLab.Builder', 'comment', '1.0.21', 'Back-end navigation sort order updated.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('24', 'RainLab.Builder', 'comment', '1.0.22', 'Added scopeValue property to the RecordList component.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('25', 'RainLab.Builder', 'comment', '1.0.23', 'Added support for balloon-selector field type, added Brazilian Portuguese translation, fixed some bugs', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('26', 'RainLab.Builder', 'comment', '1.0.24', 'Added support for tag list field type, added read only toggle for fields. Prevent plugins from using reserved PHP keywords for class names and namespaces', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('27', 'RainLab.Builder', 'comment', '1.0.25', 'Allow editing of migration code in the \"Migration\" popup when saving changes in the database editor.', '2021-01-21 08:11:49');
INSERT INTO system_plugin_history VALUES ('28', 'RainLab.Builder', 'comment', '1.0.26', 'Allow special default values for columns and added new \"Add ID column\" button to database editor.', '2021-01-21 08:11:49');
